import React from 'react'
import './form.css';

const Form = () => {
  return (
    <div className='box-form'>
      <div className='container'>
        <div className='form'>
          <h3>Want to know how to market your NFT Collections? </h3>
          <p>Head over to our blog for best tips</p>
          <a href='#'>Want to know</a>
        </div>
      </div>
    </div>
  )
}

export default Form
